import {
  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
  Input,
} from "antd";
import Link from "next/link";
import {useSelector} from 'react-redux'

const FormItem = Form.Item;
function ShowProfile() {
  const {Name,SSID,PostId,BirdDay} = useSelector(state => state.post)
  return (
    <FormItem style={{ width: "100%", height: "100%",display:"flex",justifyContent:"center",alignItems:"center" }}>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          width: "100%",
          height: "100%",
          justifyContent:"center",
          alignItems:"center"
        }}
      >
        <div
          style={{
            display: "flex",
            flexBasis: "auto",
            padding: "10px",
            justifyContent: "center",
            alignItems: "center",
            width: "100%",
            height: "100%",
          }}
        >
          <div
            style={{ width: "250px", height: "250px", background: "white",borderRadius:"68px" }}
          />
        </div>
        <div
          style={{
            display: "flex",
            flexBasis: "auto",
            flexDirection: "column",
            padding: "10px",
            width: "100%",
            height: "100%",
          }}
        >
          <h3 style={{ fontSize: "18px" }}>ชื่อ สกุล</h3>
          <div className="nu-box-covid4">{Name}</div>
          <h3 style={{ fontSize: "18px" }}>หมายเลขประจำตัวประชาชน</h3>
          <div className="nu-box-covid4">{SSID}</div>
          <h3 style={{ fontSize: "18px" }}>วัน เดือน ปีเกิด</h3>
          <div className="nu-box-covid4">{BirdDay}</div>
          <h3 style={{ fontSize: "18px" }}>รหัสไปรษณีย์</h3>
          <div className="nu-box-covid4">{PostId}</div>
        </div>
      </div>{" "}
    </FormItem>
  );
}
export default ShowProfile;
